use poseidon::poseidon::bn254::hash_2;
use std::field::bn254::lt;

struct Asset {
    amount: Field,
    addr: Field,
}

fn hash_with_asset(secrets: Field, asset: Asset) -> Field {
    let tx_hash = hash_2([hash_2([secrets, asset.addr]), asset.amount]);
    // sgn0 == 1 when odd, force even by subtracting
    tx_hash - tx_hash.sgn0() as Field
}

fn merkle_hash(a: Field, b: Field) -> Field {
    let res = if b != 0 {
        if lt(a, b) {
            hash_2([a, b])
        } else {
            hash_2([b, a])
        }
    } else {
        a
    };

    res + 1 - res.sgn0() as Field
}

fn check_merkle_root(mut merkle_temp_root: Field, proof: [Field; 20], root: Field) {
    for i in 0..20 {
        merkle_temp_root = merkle_hash(merkle_temp_root, proof[i]);
    }

    assert(root == merkle_temp_root, "incorrect merkle root");
}

struct ReturnVals {
    recipient: Field,
    asset: Asset,
    root: Field,
    nullifier: Field,
    new_tx: Field,
}

fn main(
    claiming_key: Field,
    recipient: Field,
    mut asset: Asset,
    proof: [Field; 20],
    root: Field,
    new_tx_secret: Field,
    new_tx_amount: Field,
) -> pub ReturnVals {
    // prepare merkle member from preimage

    let tx_secret = hash_2([claiming_key, recipient]);
    let tx_hash = hash_with_asset(tx_secret, asset);

    check_merkle_root(tx_hash, proof, root);

    assert(!lt(asset.amount, new_tx_amount), "insufficient funds");

    let nullifier_secret = hash_2([claiming_key + 1, recipient]);
    let nullifier = hash_with_asset(nullifier_secret, asset);
    let new_asset = Asset { amount: new_tx_amount, addr: asset.addr };
    let new_tx = if new_tx_amount == 0 {
        0
    } else {
        hash_with_asset(new_tx_secret, new_asset)
    };

    asset.amount = asset.amount - new_tx_amount;

    ReturnVals { recipient, asset, root, nullifier, new_tx }
}

// returns merkle root and proof
fn test_proof() -> (Field, [Field; 20]) {
    // From Prover.toml
    let root = 0x12b5f872ab26fe936a02b0d9c2184379ec18c27e76fa9c2bf36aad952fcae239;
    let mut proof = [0; 20];

    proof[0] = 0x87ec3b064e9550b1a5100ea02bf3cf707dd658c60ccbe38d05ea1d4820b9866;
    proof[1] = 0x18d6209a939a0fa9bc43d37d85d43227378ef2bf41e0d3844b9e1a0c7b236199;
    proof[2] = 0x216bc11a7be9067d09d7a4cd4681eb4c7e436d36ff61892fd896009c6a1869fb;
    proof[3] = 0x1526a6df23ab306af0949d738f9725a1a6126383c9c345735d9b9fd0a0eab4d5;
    proof[4] = 0x3a6970b2c1915e400be8671190a88a90052929be07cc3cfe6f2e00d99fe4ceb;

    // Remaining are zero
    (root, proof)
}

fn test_transaction_values() -> (Field, Field, Asset) {
    // From Prover.toml
    let claiming_key = 0x6162726163616461627261; // abracadabra
    let recipient = 0x6a6f65; // joe
    let amount = 100000;
    let addr = 0x2877e73feb5b7af1e12db1ff5b15db30ffa42182406241f672e9e611f42f3e1;
    (claiming_key, recipient, Asset { amount, addr })
}

#[test]
fn test_merkle() {
    let (root, proof) = test_proof();
    let (claiming_key, recipient, asset) = test_transaction_values();
    let data = main(claiming_key, recipient, asset, proof, root, 0, 0);
    assert(data.root == root, "root mismatch");
    assert(data.recipient == recipient, "recipient mismatch");
    assert(data.asset.amount == asset.amount, "asset amount mismatch");
    assert(data.asset.addr == asset.addr, "asset addr mismatch");
}

#[test]
fn test_merkle_00() {
    let root = 16247412791711058059958322912866945196043536767728836384345637472479895576331;
    let tx_hash = 0x1affedb8e47e38c50e3395b895d2763e2c7a069cae96a491e227cf531dccd8ee;
    let mut proof = [0; 20];
    proof[2] = 0x27bfeb22d767f1396415779217616f298e14276c5c119e005033256406ac14b1;
    check_merkle_root(tx_hash, proof, root);
}

#[test]
fn test_seek_and_hide() {
    let (root, proof) = test_proof();
    let (claiming_key, recipient, asset) = test_transaction_values();

    let jill = 0x6a696c6c;
    let new_tx_secret = hash_2([claiming_key + 5, jill]);

    let data = main(
        claiming_key,
        recipient,
        asset,
        proof,
        root,
        new_tx_secret,
        1000,
    );

    let new_asset = Asset { amount: 1000, addr: asset.addr };
    assert(data.new_tx == hash_with_asset(new_tx_secret, new_asset), "new tx mismatch");
}

#[test(should_fail)]
fn test_merkle_fail() {
    let (root, proof) = test_proof();
    let (_claiming_key, recipient, asset) = test_transaction_values();
    let _ = main(
        0xf00, // wrong claiming_key
        recipient,
        asset,
        proof,
        root,
        0,
        0,
    );
}

